import './App.css';
import { Canvas } from '@react-three/fiber'

function Box({props}) {
  return (
    <mesh>
          <boxGeometry args={[2, 2, 2]} />
    <meshBasicMaterial color={'hotpink'} />
    </mesh>
  )
}

function App() {
  return (
    <div id='canvas-container'>
      <Canvas>
        <mesh>
          <Box />
          <ambientLight intensity={0.5} />
          <spotLight position={[10, 10, 10]} angle={0.15} penumbra={1}/>
        </mesh>
      </Canvas>
    </div>
  );
}

export default App;
